import Layout from "../components/Layout";
import phones from "../database/index";

const Index = () => {
  const renderPhones = () => {
    const phoneList = phones.map(phone => {
      return (
        <li>
          <div>
            <a>{phone.name}</a>
          </div>
          <ul>
            <li>{newFunction(phone)}</li>
          </ul>
        </li>
      );
    });
    return phoneList;
  };

  return (
    <Layout>
      <div className="body">
        <ul>{renderPhones()}</ul>
      </div>
    </Layout>
  );
};

export default Index;
function newFunction(phone) {
  return () => {
    for (let [key, value] of Object.entries(phones)) {
      return <p>{`${key} ${value}`}</p>;
    }
  };
}
